<?php

namespace App\Console\Commands;

use Illuminate\Console\Command;
use App\Http\Controllers\ShopCount\ShopCountController;
use App\Salon;
use App\ShopCountApi;


class ShopcountImportPrepay extends Command
{
    /**
     * The name and signature of the console command.
     *
     * @var string
     */
    protected $signature = 'shopcount:import_prepay';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'import prepay data';

    protected $controller = null;
    
    /**
     * Create a new command instance.
     *
     * @return void
     */
    public function __construct(ShopCountController $contoller)
    {
        $this->controller = $contoller;
        parent::__construct();
    }
    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public function handle()
    {
        $items = self::getFormatDatas();
//         $this->table(['type','merchant_id','salon_id','pay_money','cost_money','day'], $items);
//         die();
//        echo json_encode($items,true);
        $uid = $this->ask("input your uid ",1); 
        foreach ($items as $item)
        {
            $item['uid'] = intval($uid);
            $ret = ShopCountApi::makePrepay($item);
            ShopcountStore::outputReturn($this, $ret);
        }
    }
    
    public static function getFormatDatas()
    {
		$res = [];
		$base_datas = self::getBaseData();
		$salon_ids = array_column($base_datas,1);
		$salon_ids = array_unique($salon_ids);
		$salon_ids = array_filter($salon_ids);
		$salonid_to_merchantid = self::get_merchant_ids($salon_ids);
		foreach($base_datas as $key => $data)
		{
			$salon_id = $data[1];
			$type_name = $data[4];
			$day_str = $data[5];
			$money = floatval($data[7]);
			if(empty($salon_id))
			{
				throw new \Exception("can not get salon id of line ".($key).implode(",", $data)."");			
			}	
			if(!isset($salonid_to_merchantid[$salon_id]))
			{
			    throw new \Exception("can not get salon_id {$salon_id} of line  ".($key+2));
			}
 			$merchant_id = $salonid_to_merchantid[$salon_id];
			
			if(empty($merchant_id))
			{
			    throw new \Exception("salon id {$salon_id} can not get the  merchant id of line ".($key+2));
			}
			$type = self::get_type($type_name);
			$cost_money = self::get_cost_money($money);
			$day = self::get_day($day_str);
			if(!($salon_id && $merchant_id && $money && $cost_money && $type && $day))
			{
			    throw new \Exception("some error line ".($key+2)." format data salon_id:{$salon_id} merchant_id:{$merchant_id} money:{$money} cost_money:{$cost_money} type:{$type} day:{$day} from data [".implode(",", $data)."]");
			}
			$res[] = [
			    'type'=>$type,
			    'merchant_id'=>$merchant_id,
			    'salon_id'=>$salon_id,
			    'pay_money'=>$money,
			    'cost_money'=>$cost_money,
			    'day'=>$day,
			];
		}
		return $res;
    }
    
    public static function get_merchant_ids($salon_ids)
    {
        $res = [];
        if(empty($salon_ids))
        {
            return $res;
        }
        $res = Salon::whereIn("salonid",$salon_ids)->lists('merchantId','salonid')->toArray();
        return $res;
    }
    
    public static function get_type($type_name)
    {
        $type_name=trim($type_name);
        if($type_name == "预付交易款")
        {
            return 1;
        }
        else if ($type_name == "付交易代收款")
        {
            return 2;
        }
        else if ($type_name == "交易代收款返还")
        {
            return 3;
        }
        return false;
    }
    
    public static function get_cost_money($money)
    {
        return round($money * 110)/100;
    }
    
    public static function get_day($day_str)
    {
        $str = str_replace(['年','月','日'], " ", $day_str);
        $day_arr = explode(" ", $str);
     
        $num = count($day_arr);
        if($num >= 3)
        {
            $month = str_pad($day_arr[1], 2,"0",STR_PAD_LEFT);
            $day = str_pad($day_arr[2], 2,"0",STR_PAD_LEFT);
            return date("Y-m-d",strtotime($day_arr[0]."-".$month."-".$day));
        }
        else if($num == 2)
        {
            return date("Y-m-d",strtotime($day_arr[0]."-01-01"));
        }
        return false;
    }
    
